INSERT INTO `md_data_sekolah` (`id_data_sekolah`, `nama_sekolah`, `npsn`, `nss`, `akreditasi`, `alamat`, `kodepos`, `no_telp`, `no_fax`, `email`, `jenjang`, `status`, `situs`, `lintang`, `bujur`, `ketinggian`, `waktu`, `kota`, `provinsi`, `kecamatan`, `kelurahan`, `visi`, `misi`, `tujuan`) VALUES
(1, 'SMA NEGERI 5 SEMARANG', '20328893 ', '301036306005 ', 'A', 'Jl. Pemuda 143 Semarang, Jawa Tengah', '50132 ', '(024)3543998', '-', 'sman5smg@gmail.com ', 'SMA', 'NEGERI', 'https://sman5semarang.sch.id/', '-6.948239 ', '110.41671799999995 ', '3', 'Sekolah Pagi ', 'Kota Semarang ', 'Jawa Tengah ', 'Semarang Tengah ', '-', 'Menjadi Sekolah Unggul Dalam Membentuk Insan Berakhlak Mulia Berprestasi Dan Berbudaya Dengan Menerapkan Teknologi Dan Berwawasan Global', '1. Meningkatkan sikap dan perilaku berakhlak mulia sesuai dengan nilai-nilai Pancasila melalui kurikulum, pembelajaran, pembiasaan dalam perilaku warga sekolah;\r\n2. Meningkatkan prestasi akademik dan non akademik;\r\n3. Mengembangkan teknologi dan optimalisasi manajemen pengelolaan sekolah berbasis TIK;\r\n4. Mengembangkan kemampuan berbahasa asing yang berbudaya untuk mendukung wawasan global;\r\n5. Memupuk rasa cinta tanah air melalui aktifitas di bidang seni dan budaya Indonesia;\r\n6. Mengoptimalkan gerakan literasi sekolah\r\n', '1. Menghasilkan lulusan yang berprestasi, kompetitif dan berakhlak mulia\r\n2. Menerapkan nilai-nilai karakter dalam sikap dan perilaku warga sekolah\r\n3. Membina budaya meneliti  dengan pendekatan saintifik pada peserta didik.\r\n4. Menyiapkan lulusan yang kompeten dalam bidang akademik untuk melanjutkan ke perguruan tinggi\r\n5. Menyiapkan peserta didik yang kompeten dalam karya tulis ilmiah di tingkat nasional dan internasional\r\n6. Mewujudkan manajemen pengelolaan sekolah berbasis TIK');
